contracts/CheckEncode.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CheckEncode {


  function checkEncodeMakerAsset(bytes memory data) public pure returns (address, uint256){
    (address token, uint tokenId) = abi.decode(data, (address, uint));
     return (token, tokenId);
  }

  function checkEncodeTakerAsset(bytes memory data) public pure returns(address) {
    (address buyToken) = abi.decode(data, (address));
    return buyToken;
  }

}

